        navit("/Reviews")
    }
    return (
        <div>
            <div className='kia'>
            <button className="dcx" onClick={arro}>&lt;</button>
            <img src="/asset/ball (1).png" alt="" className='ajk'/>
            <img src="/asset/piu.png" alt="" className='cvrt'/>
            <h3>Pizza Hut</h3>
            <p>4002 pretty view</p>
