            <h5 className='rdf'>Good</h5>
            <p className='faz'>****</p>
            <input className='tyu' type="text" placeholder='write something'/>
            <button className='klb' onClick={handleas}>Submit</button>
            </div>
        </div>
    )
}

export default Rating
